import React from 'react';

import './YourColoradoCharity.css';

const YourColoradoCharity = props => {
  return (
    <section className="YCC" id="about">
      <h1 className="YCC__h1">YCC</h1>
      <h2 className="YCC__h2">Welcome to Your Colorado Charity info page. In this paragraph, we give information about being located in Denver, Colorado and establish it as a hub for charities</h2>
      <br/>
      <h2 className="YCC__h2">In this paragraph, we specify the services we offer and tie it into the branding statement</h2>
      <br/>
      <h2 className="YCC__h2">This is a different paragraph highlighting the diversity of our clients and inviting users to scroll down and learn more about each one</h2>
      <br/>
    </section>
  )
};

export default YourColoradoCharity;
